import React from "react";
import ItemList from "../ItemList";
import {
  withData,
  withSwapiService,
  withChildFunction,
  compose
} from "../hoc-helper";

const renderName = ({ name }) => <span>{name}</span>;

const renderNameAndModel = ({ name, model }) => (
  <span>
    {name} ({model})
  </span>
);
const mapPersonMethodToProps = swapiService => {
  return {
    getData: swapiService.getAllPeople
  };
};
const mapPlanetMethodToProps = swapiService => {
  return {
    getData: swapiService.getAllPlanets
  };
};
const mapStarshipMethodToProps = swapiService => {
  return {
    getData: swapiService.getAllStarships
  };
};

const PersonList = compose(withSwapiService(mapPersonMethodToProps),withData,withChildFunction(renderName))(ItemList);

const PlanetList = compose(withSwapiService(mapPlanetMethodToProps),withData,withChildFunction(renderName))(ItemList);
const StarshipList = withSwapiService(mapStarshipMethodToProps)(
  withData(withChildFunction(renderNameAndModel)(ItemList))
);
console.log(PersonList);

export { PersonList, PlanetList, StarshipList };
